				width='100%'
				height='92%'
				frameborder='0'
				scrolling='no'
				marginheight='0'
                marginwidth='0'
                style ={{}}
				src='https://www.openstreetmap.org/export/embed.html?bbox=-180.35156250000003%2C-52.908902047770255%2C211.99218750000003%2C82.02137801950887&amp;layer=cyclemap'></iframe>

		</>
	);
};

export default App;

